import React from "react";
import { NavLink } from "react-router-dom";


const linkStyles = {
  display: "inline",
  width: "50px",
  padding: "0",
  margin: "0",
  background: "blue",
  textDecoration: "none",
  color: "white",
  overflow: "hidden"
};

function Navbar() {
  return (
    <div>
      <NavLink
        to="/"
        exact
        style={linkStyles}
        activeStyle={{
          background: "darkblue",
        }}
      >
        Home
      </NavLink>

      <NavLink
        to="/doctors"
        exact
        style={linkStyles}
        activeStyle={{
          background: "darkblue",
        }}
      >
        Doctors
      </NavLink>

      <NavLink
        to="/patients"
        exact
        style={linkStyles}
        activeStyle={{
          background: "darkblue",
        }}
      >
        Patients
      </NavLink>
    </div>
  );
}

export default Navbar;
